    notes: 
      usage: |-
        
        Formatting errors, evolving implementations for infobox templates, and
        the nature of user-generated content mean that there are many
        inconsistencies within infobox groupings.  For example, the same date
        field may in some cases be populated by a full date string, in others
        a year, and in others a date-formatting template instance.
        
        However, these are still in somewhat rough shape and may have
        conversion errors.  Please report bugs at
        http://getsatisfaction.com/infochimps -- and if you are interested in helping
        to improve these datasets "contact the infochimps":http://help.infochimps.org/help/show/Contact
        
        Furthermore, parameters to wikipedia templates can be given positionally
        or by name.  If there are many fields labelled '1:', '2:', etc you will have
        to refer to the original Template page on wikipedia to map these fields.
